    status = 'current'
    subtypeSpec = Integer32.subtypeSpec + ConstraintsUnion(SingleValueConstraint(1, 2, 3))
    namedValues = NamedValues(("software", 1), ("clientHardware", 2), ("clientAndServerHardware", 3))

